import {getRequest, IApiRes} from "../commons/services/BaseService";

export interface IResListUser {
    id: number
    email: string
    username: string
    password: string
    name: {
        firstname: string
        lastname: string
    }
    address: {
        city: string
        street: string
        number: number
        zipcode: string
        geolocation: {
            lat: string
            long: string
        }
    }
    phone: string
}

export function getListUser(url: string): Promise<IApiRes<IResListUser []>> {
    return getRequest(url);
}
